import React from 'react';
import { BiChevronRight, BiChevronLeft } from "react-icons/bi";
import Heading from '../Heading';


function Password({ showSubContent, setshowSubContentClick }) {

    return (
        <div>
            <h1 onClick={() => setshowSubContentClick(0)} className="me-2 d-block d-sm-none" >
                    <BiChevronLeft
                      className="required"
                    />
                    <Heading content="Password"  />
                  </h1>
            <p>vvv {showSubContent}</p>

        </div>
    )
}

export default Password
